pragma solidity >=0.4.21 <0.7.0;
pragma experimental ABIEncoderV2;

import './TicketData.sol';

contract Ticket {
    address private _admin;
    TicketData private _ticketData;
    string public _issuer;
    address public _scenicAddr;
    string public _scenicName;
    string public _ticketId;
    uint public _price;
    uint public _total;
    uint public _issued;
    uint64 public _sDate;
    uint64 public _eDate;
    string public _comment;
    string[] public _cTickets;
    mapping(string => cTicketInfo) _cTicketList;

    uint TICKET_NORMAL = 0;
    uint TICKET_LOCKED = 1;
    uint TICKET_USED = 2;
    uint TRANSFER_NORMAL = 0;
    uint TRANSFER_PROCESS = 1;
    uint TRANSFER_ACCEPTED = 2;
    uint TRANSFER_REFUSED = 3;

    string EMIT_MINT = "mint";
    string EMIT_ACCEPT = "AcceptTransfer";
    string EMIT_BUY = "BuyFromMarket";
    string EMIT_USED = "used";

    struct cTicketInfo {
        bool exist;
        address holder;
        uint state;
        transferInfo tInfo;
        string comment;
    }

    struct transferInfo {
        uint256 transferPrice;
        address toUser;
        uint state;
    }

    constructor(string memory issuer, string scenicName, address scenicAddr, string ticketId, uint price, uint total, uint64 sDate, uint64 eDate, string memory comment, address ticketDataAddr) public {
        _admin = tx.origin;
        _issuer = issuer;
        _scenicName = scenicName;
        _scenicAddr = scenicAddr;
        _ticketId = ticketId;
        _price = price;
        _total = total;
        _sDate = sDate;
        _eDate = eDate;
        _comment = comment;
        _ticketData = TicketData(ticketDataAddr);
    }

    function _updateTicket(string memory issuer, string scenicName, address scenicAddr, uint price, uint total, uint64 sDate, uint64 eDate, string memory comment) public {
        require( _total >= _issued, "total ticket number error");
        _issuer = issuer;
        _scenicName = scenicName;
        _scenicAddr = scenicAddr;
        _price = price;
        _total = total;
        _sDate = sDate;
        _eDate = eDate;
        _comment = comment;
    }

    function _mintTicket(address userAddr, string[] cTicketIds) public {
        require((_issued + cTicketIds.length <= _total), "no ticket left");
        require((_admin == tx.origin), "only issuer company can mint ticket");
        for( uint i=0; i < cTicketIds.length; i++){
            string memory cTicketId = cTicketIds[i];
            require((_cTicketList[cTicketId].exist == false), "this cTicket already mintted");
            _cTickets.push(cTicketId);
            _cTicketList[cTicketId].exist = true;
            _cTicketList[cTicketId].holder = userAddr;
            _cTicketList[cTicketId].state = TICKET_NORMAL;
            _issued ++;
            _ticketData._TicketTrace(cTicketId, userAddr, _price, EMIT_MINT);
        }
    }

    function _transferTicket(address toUser, string[] cTicketIds, uint transferPrice) public {
        for(uint i=0; i < cTicketIds.length; i++){
            require((_cTicketList[cTicketIds[i]].holder == tx.origin), "this user is not holder of such ticket");
            string memory cTicketId = cTicketIds[i];
            _cTicketList[cTicketId].state = TICKET_LOCKED;
            _cTicketList[cTicketId].tInfo.toUser = toUser;
            _cTicketList[cTicketId].tInfo.transferPrice = transferPrice;
            _cTicketList[cTicketId].tInfo.state = TRANSFER_PROCESS;
        }
    }

    function _listTicket(string[] cTicketIds, uint transferPrice) public {
        for(uint i=0; i < cTicketIds.length; i++){
            require((_cTicketList[cTicketIds[i]].holder == tx.origin), "this user is not holder of such ticket");
            string memory cTicketId = cTicketIds[i];
            _cTicketList[cTicketId].state = TICKET_LOCKED;
            _cTicketList[cTicketId].tInfo.toUser = address(0);
            _cTicketList[cTicketId].tInfo.transferPrice = transferPrice;
            _cTicketList[cTicketId].tInfo.state = TRANSFER_PROCESS;
        }
    }

    function _cancelSoldTicket(string[] cTicketIds) public {
        for(uint i=0; i < cTicketIds.length; i++){
            require((_cTicketList[cTicketIds[i]].holder == tx.origin), "this user is not holder of such ticket");
            string memory cTicketId = cTicketIds[i];
            _cTicketList[cTicketId].state = TICKET_NORMAL;
            _cTicketList[cTicketId].tInfo.toUser = address(0);
            _cTicketList[cTicketId].tInfo.state = TRANSFER_NORMAL;
        }

    }

    function _acceptTicket(string[] cTicketIds, uint state) public {
        for(uint i=0; i < cTicketIds.length; i++){
            require((_cTicketList[cTicketIds[i]].tInfo.toUser == tx.origin), "this user is unable to accpet");
            require((_cTicketList[cTicketIds[i]].tInfo.state == TRANSFER_PROCESS), "this ticket is unable to accept");
            string memory cTicketId = cTicketIds[i];
            if(state == 0){
                _cTicketList[cTicketId].state = TICKET_NORMAL;
                _cTicketList[cTicketId].holder = tx.origin;
                _cTicketList[cTicketId].tInfo.state = TRANSFER_ACCEPTED;
                _ticketData._TicketTrace(cTicketId, tx.origin, _cTicketList[cTicketId].tInfo.transferPrice, EMIT_ACCEPT);
            }else {
                _cTicketList[cTicketId].tInfo.state = TRANSFER_REFUSED;
            }
        }
    }

    function _buyTicketFromMarket(string[] cTicketIds) public {
        for(uint i=0; i < cTicketIds.length; i++){
            require((_cTicketList[cTicketIds[i]].tInfo.state == TRANSFER_PROCESS), "this ticket is unable to accept");
            string memory cTicketId = cTicketIds[i];
            _cTicketList[cTicketId].state = TICKET_NORMAL;
            _cTicketList[cTicketId].holder = tx.origin;
            _cTicketList[cTicketId].tInfo.state = TRANSFER_ACCEPTED;
            _ticketData._TicketTrace(cTicketId, tx.origin, _cTicketList[cTicketId].tInfo.transferPrice, EMIT_BUY);
        }
    }

    function _checkcTicket(address userAddr,string cticketId) public {
        require((_cTicketList[cticketId].holder == userAddr), "this user is not holder of such ticket");
        require((_cTicketList[cticketId].state == TICKET_NORMAL), "this ticket is unable to use");
        require((_scenicAddr == tx.origin),"only scenic can check ticket");
        _cTicketList[cticketId].state = TICKET_USED;
        uint price;
        if(_cTicketList[cticketId].tInfo.state == TRANSFER_NORMAL){
            price = _price;
        } else {
            price = _cTicketList[cticketId].tInfo.transferPrice;
        }
        _ticketData._TicketTrace(cticketId, tx.origin, price, EMIT_USED);
    }

    function _getTicketInfo() public view returns (string memory issuer, address scenicAddr, uint price, uint total, uint issued, uint64 sDate, uint64 eDate) {
        issuer = _issuer;
        scenicAddr = _scenicAddr;
        price = _price;
        total = _total;
        issued = _issued;
        sDate = _sDate;
        eDate = _eDate;
    }
    
    function _getcTicketInfo(string cticketId) public view returns (address holder, uint state) {
        holder = _cTicketList[cticketId].holder;
        state = _cTicketList[cticketId].state;
    }
    
    function _getcTicketTransferInfo(string cticketId) public view returns (address toUser, uint transferPrice, uint256 transferState) {
        toUser = _cTicketList[cticketId].tInfo.toUser;
        transferPrice = _cTicketList[cticketId].tInfo.transferPrice;
        transferState = _cTicketList[cticketId].tInfo.state;
    }
}
